import React from 'react';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import PopupState, { bindTrigger, bindMenu } from 'material-ui-popup-state';
import {Link} from "react-router-dom";

export default function MenuPopupState() {

    return (
        <PopupState variant="popover" popupId="demo-popup-menu">
            {(popupState) => (
                <React.Fragment>
                    <Button variant="contained" color="primary" {...bindTrigger(popupState)}>
                        Open Menu
                    </Button>
                    <Menu {...bindMenu(popupState)}>
                        <MenuItem linkButton containerElement={<Link to="/CreateUser"/>} primaryText="User"></MenuItem>
                        <MenuItem>
                                <Link className="nav-link" to="/CreateGame">Games</Link>
                        </MenuItem>
                        <MenuItem>
                                <Link className="nav-link" to="/CreateReview">Review</Link>
                        </MenuItem>
                        <MenuItem>
                                <Link className="nav-link" to="/CreateKey">Keys</Link>
                        </MenuItem>
                    </Menu>
                </React.Fragment>
            )}
        </PopupState>
    );
}

